    public CodeGenerator()
    {
        templates = new Dictionary<string, string>
        {
            { "Class", "class {0}\n{{\n{1}\n}}" },
            { "Method", "{0} {1}({2})\n{{\n{3}\n}}" },
            { "Property", "{0} {1} {{ get; set; }}" }
        };

        userFormats = new Dictionary<string, string>();
    }

    public void SetUserFormat(string key, string format)
    {
        userFormats[key] = format;
    }

